import React, { Component } from 'react'
import axios from 'axios'

export default class Secret extends Component {
  constructor() {
    super();
    this.state = {
      message: 'Loading...'
    }
  }
  componentDidMount() {
      axios.get('/api/v1/secret')
        .then(res => {
            console.log(res)
            return res
        })
        .then(res => this.setState({message: res['data']}));
  }
  render() {
    return (
      <div>
        <h1>Secret</h1>
        <p>{this.state.message}</p>
      </div>
    );
  }
}
